import java.util.Scanner;
import java.util.Map;
import java.util.HashMap;

/**
 * Objectif
 * Autrefois, les gens s'amusaient Ã  transformer des "recettes" en images surprises Ã  l'aide de machines Ã  Ã©crire.
 * Utilisez la recette fournie pour crÃ©er une image reconnaissable.
 * 
 * Les morceaux de la recette sont sÃ©parÃ©s par un espace.
 * Chaque morceau vous indiquera soit :
 * - nl signifiant Nouvelle Ligne (retour chariot)
 * - ~ou~
 * - combien de fois rÃ©pÃ©ter un caractÃ¨re donnÃ©
 * 
 * Par exemple :
 * - 4z signifie zzzz
 * - 1{ signifie {
 * - 10= signifie ==========
 * - 5bS signifie \\\\\ (voir la liste des abrÃ©viations ci-dessous)
 * - 27 signifie 77
 * - 123 signifie 333333333333 (si un morceau est composÃ© uniquement de chiffres, le caractÃ¨re est le dernier chiffre.)
 * 
 * Donc, si une partie de la recette est
 * 2* 15sp 1x 4sQ nl
 * ... cela signifie d'afficher
 * **               x''''
 * puis passer Ã  une nouvelle ligne.
 * 
 * AbrÃ©viations utilisÃ©es :
 * - sp = espace
 * - bS = barre oblique inversÃ©e \
 * - sQ = apostrophe simple '
 * et
 * - nl = Nouvelle Ligne
 * 
 * Sources/rÃ©fÃ©rences :
 * https://asciiart.cc
 * https://loriemerson.net/2013/01/18/d-i-y-typewriter-art/
 * https://www.youtube.com/watch?v=kyK5WvpFxqo
 * 
 * EntrÃ©e
 * Une chaÃ®ne de caractÃ¨res reprÃ©sentant la recette
 * 
 * Sortie
 * Une chaÃ®ne de caractÃ¨res (sur plusieurs lignes) reprÃ©sentant l'image crÃ©Ã©e par la recette
 * 
 * Contraintes
 * 5 â‰¤ Longueur de la recette â‰¤ 1000
 * Il n'y aura pas de guillemets doubles (") dans la recette
 * La recette contiendra au moins 1 nl (Nouvelle Ligne)
 * 
 * Exemple
 * EntrÃ©e
 * 1sp 1/ 1bS 1_ 1/ 1bS nl 1( 1sp 1o 1. 1o 1sp 1) nl 1sp 1> 1sp 1^ 1sp 1< nl 2sp 3|
 * Sortie
 *  /\_/\
 * ( o.o )
 *  > ^ <
 *   |||
 **/
class Solution {

    public static void main(String args[]) {
        final Scanner in = new Scanner(System.in);
        final String T = in.nextLine();

        // DÃ©finition des abrÃ©viations utilisÃ©es
        Map<String, String> abbr = new HashMap<String, String>(); {
            abbr.put("sp", " ");
            abbr.put("bS", "\\\\");
            abbr.put("sQ", "\'");
            abbr.put("nl", "\n");
        }
        
        final StringBuilder sb = new StringBuilder();

        // DÃ©limiteur utilisÃ© pour sÃ©parer les morceaux de la recette
        final String delimiter = " ";
        final String[] symbols = T.split(delimiter);
        
        for (String s : symbols) {
            // Remplacement des abrÃ©viations par leur valeur correspondante
            for (Map.Entry<String, String> entry : abbr.entrySet()) {
                s = s.replaceAll(entry.getKey(), entry.getValue());
            }
            
            int firstCharIndex = 0;
            for (Character c : s.toCharArray()) {
                if (Character.isDigit(c)) firstCharIndex++;
                else break;
            }
            Integer r;
            String content;
            if (firstCharIndex > 0) {
                // Si le morceau commence par des chiffres, rÃ©cupÃ©rer le nombre
                r = Integer.parseInt(s.substring(0, firstCharIndex));
                content = s.substring(firstCharIndex, s.length());
            } else {
                r = 1;
                content = s;
            }
            
            // RÃ©pÃ©ter le contenu du morceau la bonne quantitÃ© de fois
            for (int i = 0; i < r; i++) {
                sb.append(content);
            }
        }
        System.out.println(sb.toString());
    }
}

