#include <bits/stdc++.h>

using namespace std;

#define MOD 1000000007
// #define INF 1e9
#define pb push_back
#define ppb pop_back
#define ff first
#define ss second
#define set_bits __builtin_popcountll
#define nl '\n'
#define sz(x) ((int)(x).size())
#define all(x) (x).begin(), (x).end()
#define fastio()                      \
    ios_base::sync_with_stdio(false); \
    cin.tie(NULL);                    \
    cout.tie(NULL)

typedef long long ll;

const int MAXN = 1e5 + 5, c = 450, INF = 1e9;

struct query {
    int l, r, idx;
    query() {}
    query(int l, int r, int idx) : l(l), r(r), idx(idx) {}
};

struct edge {
    int v, to, w, idx;
    edge() {}
    edge(int v, int to, int w, int idx) : v(v), to(to), w(w), idx(idx) {}
};

int n, m;
vector<edge> g[MAXN];
int first[MAXN], ans[MAXN];
bool used[MAXN];
vector<int> euler, edges;
vector<query> queries, b[c];

int cnt[c * c], block[c];

void build() {
    for (int i = 0; i < c; i++) block[i] = 0;
    for (int i = 0; i < c * c; i++) {
        cnt[i] = 0;
        block[i / c]++;
    }
}

void add(int pos) {
    if (cnt[pos] == 0) block[pos / c]--;
    cnt[pos]++;
}

void del(int pos) {
    if (cnt[pos] == 1) block[pos / c]++;
    cnt[pos]--;
}

int get() {
    int pos = 0;
    while (block[pos] == 0 && pos < c) pos++;
    pos *= c;
    while (cnt[pos] > 0) pos++;
    return pos;
}

void dfs(int v, int p = -1) {
    first[v] = (int)euler.size();
    for (edge & e : g[v]) {
        if (e.to == p) continue;
        euler.push_back(e.w);
        edges.push_back(e.idx);
        dfs(e.to, v);
        euler.push_back(e.w);
        edges.push_back(e.idx);
    }
}

void change(int k) {
    int cur = euler[k], idx = edges[k];
    if (cur >= c * c) return;
    if (used[idx]) {
        used[idx] = false;
        del(cur);
    } else {
        used[idx] = true;
        add(cur);
    }
}

int32_t main() {
    fastio();
    cin >> n >> m;
    for (int i = 0; i < n - 1; i++) {
        int u, v, w;
        cin >> u >> v >> w;
        u--;
        v--;
        g[u].push_back(edge(u, v, w, i));
        g[v].push_back(edge(v, u, w, i));
    }
    dfs(0);
    for (int i = 0; i < m; i++) {
        int u, v;
        cin >> u >> v;
        u--; v--;
        if (u == v) {
            ans[i] = 0;
            continue;
        }
        if (first[u] > first[v]) swap(u, v);
        queries.emplace_back(query(first[u], first[v] - 1, i));
    }
    sort(queries.begin(), queries.end(), [](query a, query b){return a.r < b.r;});
    for (query q : queries) {
        b[q.l / c].push_back(q);
    }
    for (int i = 0; i < c; i++) {
        int l = i * c, r = i * c - 1;
        build();
        memset(used, false, sizeof(used));
        for (query q : b[i]) {
            while (l < q.l) change(l++);
            while (r < q.r) change(++r);
            while (l > q.l) change(--l);
            ans[q.idx] = get();
        }
    }
    for (int i = 0; i < m; i++) cout << ans[i] << endl;
    return 0;
}

