alias rem-perform {
  var %line,%f $_txtdir(perform.txt),%l $lines(%f)
  if ($read(%f,tnw,[[ $+ $1 $+ ]])) {
    var %line $readn + 1
    while (%line <= %l) {
      var %r $read(%f,tn,%line)
      if (!$regex(%r,/^\[[^\]\[]+\]$/)) && ($readn <= %l) {
        write -dl %line $qt(%f)
        dec %l
      }
      else { break }
    }
  }
  if (%line) write -dl $calc(%line -1) $qt(%f)
}
